import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="logo">
        <p>fenomenden.com</p>
      </div>
      <div className="search">
        <input placeholder="Arama Yap" /> <button>Ara</button>
      </div>
      <div className="menu">
        <ul>
          <li>
            <a href="/login">Giriş Yap</a>
          </li>
          <li>
            <a href="#">İlan Ver</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
